import React from 'react';
import styled from "styled-components";

const Container = styled.div`
  background-color: #018fa6;
  margin: 0;
  padding: 0;
  position: relative;
  width: 100%;
`;

const Navbar = () => {
    return (
        <Container>
            <nav>
                <ul>
                    <li><a href="#">홈</a></li>
                    <li><a href="#">서비스</a></li>
                    <li><a href="#">포트폴리오</a></li>
                    <li><a href="#">연락</a></li>
                </ul>
            </nav>
        </Container>
    );
};

export default Navbar;
